import React from "react";
import {Link} from "react-router-dom";
import './style/styie.css';
import { AiFillCaretRight } from "react-icons/ai";
import { AiFillSmile } from "react-icons/ai";
function Sidebar(){
    return (
        <div className="left-column">

            <AiFillCaretRight/>Dashboard
                <div className="Dsb">
                    <Link to="/"><AiFillSmile/>Dashboard </Link>
                    <Link to="/setting"><AiFillSmile/>Default</Link>
                    <Link to="/visualization"><AiFillSmile/>eCommerce</Link>
                    <Link to="/note"><AiFillSmile/>Projects</Link>
                    <Link to="/aboutME"><AiFillSmile/>OnlineCourses </Link>
                </div>

            </div>
            /*
        <div>

        </div>*/
    );
}

export default Sidebar;
